// MenuAdapter.kt
import android.view.LayoutInflater
import android.view.View
import android.view.ViewGroup
import android.widget.ImageView
import android.widget.TextView
import androidx.recyclerview.widget.RecyclerView

class MenuAdapter(private val menuList: List<MenuModel>) : RecyclerView.Adapter<MenuAdapter.ViewHolder>() {
    override fun onCreateViewHolder(parent: ViewGroup, viewType: Int): ViewHolder {
        // 创建菜单项视图
        return ViewHolder(LayoutInflater.from(parent.context).inflate(R.layout.menu_item, parent, false))
    }

    override fun onBindViewHolder(holder: ViewHolder, position: Int) {
        // 绑定菜单项数据
        holder.name.text = menuList[position].name
        holder.price.text = menuList[position].price.toString()
        holder.description.text = menuList[position].description
        holder.image.setImageResource(R.drawable.menu_image)
    }

    override fun getItemCount(): Int {
        return menuList.size
    }

    class ViewHolder(itemView: View) : RecyclerView.ViewHolder(itemView) {
        val name: TextView = itemView.findViewById(R.id.menu_name)
        val price: TextView = itemView.findViewById(R.id.menu_price)
        val description: TextView = itemView.findViewById(R.id.menu_description)
        val image: ImageView = itemView.findViewById(R.id.menu_image)
    }
}

